  !function(mpld3){
       
    mpld3.register_plugin("hoverinfo", ClickInfoPlugin);
    ClickInfoPlugin.prototype = Object.create(mpld3.Plugin.prototype);
    ClickInfoPlugin.prototype.constructor = ClickInfoPlugin;
    ClickInfoPlugin.prototype.requiredProps = ["id","coords"];
    function ClickInfoPlugin(fig, props){
        mpld3.Plugin.call(this, fig, props);
    };
    ClickInfoPlugin.prototype.draw = function(){
        var fig = this.fig;
        var el = mpld3.get_element(this.props.id);
        var coords = this.props.coords;
        var ax = fig.axes[0];
        var container = (fig.canvas && fig.canvas.parentNode) ? fig.canvas.parentNode : document.body;

        // floating info div
        var info = document.createElement('div');
        info.style.position = 'absolute';
        info.style.background = 'black';
        info.style.color = 'white';
        info.style.border = '1px solid #333';
        info.style.padding = '6px';
        info.style.display = 'none';
        info.style.pointerEvents = 'none';
        info.style.zIndex = 9999;
        container.appendChild(info);

        var sel = null;

        // on hover show; on mouseout hide
        el.elements().on("mouseover", function(d, i){
            var px = coords[i][0], py = coords[i][1];
            var name = '001_' + String(i).padStart(3,'0') + '_XX_078_P';
            var ev = d3.event;
            if(ev && ev.pageX !== undefined){
                info.style.left = (ev.pageX + 10) + 'px';
                info.style.top  = (ev.pageY + 10) + 'px';
            } else {
                var rect = container.getBoundingClientRect();
                info.style.left = (rect.left + 10) + 'px';
                info.style.top  = (rect.top + 10) + 'px';
            }
            info.innerHTML = 'name: ' + name;
            info.style.display = 'block';

            if(sel && sel.parentNode){ sel.parentNode.removeChild(sel); sel = null; }

            var svg = container.querySelector('svg');
            if(!svg){ return; }
            var sx = ax.x.scale(px), sy = ax.y.scale(py);
            sel = document.createElementNS('http://www.w3.org/2000/svg','circle');
            sel.setAttribute('cx', sx);
            sel.setAttribute('cy', sy);
            sel.setAttribute('r', 8);
            sel.setAttribute('fill', 'black');
            sel.setAttribute('stroke', 'white');
            sel.setAttribute('stroke-width', 2);
            sel.setAttribute('class', 'mpld3-selected-point');
            svg.appendChild(sel);
        });

        el.elements().on("mouseout", function(d, i){
            info.style.display = 'none';
            if(sel && sel.parentNode){ sel.parentNode.removeChild(sel); sel = null; }
        });
    }
